import React from "react";
import "./About.css";
import Image from "../images/me.jpg";
import CardV1 from "../Card/CardV1/CardV1.js";
export default function About() {
    return (
        <>
        <div id="navBarSpacer"></div>
        <div id="about">
            <div className="spacer"></div>
            <img src={Image} alt="" className="profilePic"/>
            <h2>Hello. My name is Shawn!</h2>
            <p id="description">
                Thank you for taking interest in me. I have a Bachelor's of Engineering with 
                focus in Software Engineering.
                I owe my foundations in backend development to school, but through self learning I have picked up
                enough knowledge to create sleek front-end experiences.
            </p>
            <hr id="spacing"/>
           <div className="skills">

           </div>
        </div>
        </>
    );
}
